import React from 'react';
import './About.css';

function About() {
  const skills = [
    'Cloud Computing', 'Cybersecurity', 'AI Integration', 
    'IT Infrastructure', 'Data Analytics', 'DevOps'
  ];

  const experiences = [
    {
      year: '2023',
      title: 'AI Integration Specialist',
      description: 'Expanded expertise to include AI integration in IT solutions.'
    },
    {
      year: '2021',
      title: 'IT Solutions Architect',
      description: 'Promoted to IT Solutions Architect, focusing on enterprise solutions.'
    },
    {
      year: '2019',
      title: 'Cloud Certification',
      description: 'Obtained AWS Solutions Architect certification.'
    },
    {
      year: '2017',
      title: 'First IT Role',
      description: 'Landed my first job as a junior IT support specialist.'
    },
    {
      year: '2015',
      title: 'Started IT Journey',
      description: 'Began exploring the world of IT and programming.'
    }
  ];

  return (
    <div className="about">
      <section className="about-hero">
        <h1>About Me</h1>
        <p className="tagline">Passionate IT Solutions Architect</p>
      </section>

      <section className="about-content">
        <div className="about-intro">
          <h2>Who I Am</h2>
          <p>As a tech enthusiast and IT Solutions Architect, I've dedicated my career to simplifying complex technological challenges for businesses. With expertise in Microsoft 365, cloud computing, and enterprise systems like Odoo ERP, I enable businesses to operate efficiently, securely, and with a future-focused mindset.</p>
        </div>

        <div className="skills-section">
          <h2>My Skills</h2>
          <div className="skills-grid">
            {skills.map((skill, index) => (
              <div key={index} className="skill-item">{skill}</div>
            ))}
          </div>
        </div>

        <div className="experience-section">
          <h2>Professional Journey</h2>
          <div className="experience-timeline">
            {experiences.map((exp, index) => (
              <div key={index} className="experience-item">
                <div className="experience-year">{exp.year}</div>
                <div className="experience-details">
                  <h3>{exp.title}</h3>
                  <p>{exp.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="mission-section">
          <h2>My Mission</h2>
          <p>To empower businesses by delivering comprehensive IT solutions that optimize performance, ensure security, and support growth. I'm committed to implementing technology that not only meets today's demands but anticipates tomorrow's challenges.</p>
        </div>
      </section>
    </div>
  );
}

export default About;
